olap.QueryLevel=function(t,n){this.hierarchy=t,this.level=n,this.inclusions=[],this.exclusions=[]},olap.QueryLevel.prototype={getQuery:function(){return this.query},getName:function(){return this.level.getName()},getUniqueName:function(){return this.level.getUniqueName()},getCaption:function(){return this.level.getCaption()},getQueryHierarchy:function(){return this.hierarchy},getLevel:function(){return this.level},getInclusions:function(){return this.inclusions},getExclusions:function(){return this.exclusions},include:function(t){this.inclusions.indexOf(t)==-1&&this.inclusions.push(t)},exclude:function(t){this.inclusions.indexOf(t)!=-1&&this.inclusions.splice(this.inclusions.indexOf(t)),this.exclusions.indexOf(t)==-1&&this.exclusions.push(t)}};
